@base <http://lod.csd.auth.gr/atm/atm.ttl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <> .

atm:ATM rdf:type owl:Class .
atm:BankComputer rdf:type owl:Class .
atm:CashCard rdf:type owl:Class .
atm:Password rdf:type owl:Class .
atm:Request rdf:type owl:Class .

atm:sends rdf:type owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Request .

atm:verifies rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Request ;
    rdfs:range atm:Password .

atm:checks rdf:type owl:ObjectProperty ;
    rdfs:domain atm:BankComputer ;
    rdfs:range atm:Password .

atm:validFor rdf:type owl:ObjectProperty ;
    rdfs:domain atm:Password ;
    rdfs:range atm:CashCard .

atm:valid rdf:type owl:Class ;
    rdfs:subClassOf atm:CashCard .

atm:Password rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:validFor ;
    owl:someValuesFrom atm:valid ] .

atm:BankComputer rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:checks ;
    owl:someValuesFrom atm:Password ] .

atm:ATM rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:sends ;
    owl:someValuesFrom atm:Request ] .

atm:Request rdfs:subClassOf [ rdf:type owl:Restriction ;
    owl:onProperty atm:verifies ;
    owl:someValuesFrom atm:Password ] .
